const Portfolio = (props) => {
  return (
    <div style={props.activePortfolio ? {zIndex: '-1'} : {zIndex: '99'} }
      className={
        props.activePortfolio
          ? "portfolio-cont" : "portfolio-cont active-portfolio"
      }
    >
      <div className={props.activePortfolio
          ? "portfolio" : "portfolio active-portfolio"
      }>

      <h1>Portfolio</h1>


      </div>
    </div>
  );
};

export default Portfolio;
